import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
    return (
        <div>
            <h1>Data Table MUI</h1>  

            <ul className='nav-bar'>
                <li>
                    <Link>Home</Link>
                </li>

                <li>
                    <Link>Details</Link>
                </li>
            </ul>

        </div>
    );
}

export default Header;
